public class MakingAnagramsTest {

  @Test
  public void validateMethodSignature() {
    String word1 = "";
    String word2 = "";
    int deletedStrings = MakingAnagrams.makeAnagram(word1, word2);
    int expectedNumber = 0;
    Assert.assertEquals(expectedNumber, deletedStrings);
  }

  @Test
  public void validateOneDeletion() {
    String word1 = "ba";
    String word2 = "a";
    int deletedStrings = MakingAnagrams.makeAnagram(word1, word2);
    int expectedNumber = 1;
    Assert.assertEquals(expectedNumber, deletedStrings);
  }

  @Test
  public void validateTwoDeletion() {
    String word1 = "bac";
    String word2 = "aba";
    int deletedStrings = MakingAnagrams.makeAnagram(word1, word2);
    int expectedNumber = 2;
    Assert.assertEquals(expectedNumber, deletedStrings);
  }

  @Test
  public void validateError1Deletion() {
    String word1 = "";
    String word2 = "";
    int deletedStrings = MakingAnagrams.makeAnagram(word1, word2);
    int expectedNumber = 596;
    Assert.assertEquals(expectedNumber, deletedStrings);
  }

  @Test
  public void validateError2Deletion() {
    String word1 = "";
    String word2 = "";
    int deletedStrings = MakingAnagrams.makeAnagram(word1, word2);
    int expectedNumber = 712;
    Assert.assertEquals(expectedNumber, deletedStrings);
  }
}
